import React from 'react';
import '../App.css';
import {Link} from 'react-router-dom';
import { connect } from "react-redux"

import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import { Badge } from '@material-ui/core';

const mapStateToProps = (state) =>{
  return { productincart : state}
}

class NavBar extends React.Component {
  navliststyle = {
    color: 'black',
  }
  render(){
  return (
    <div >
    <nav className='navbar navbar-expand-lg '>
      <Link className="navbar-brand" to="/">
      <img className='logo' src='https://cdn.iconscout.com/icon/free/png-256/food-809-675214.png' alt='logofood'/>
      </Link>
      <div className="collapse navbar-collapse">
      <ul className='navbar-nav'>
        {this.props.navitems.map(navitem => 
        <li className="nav-item">
          <Link className="nav-link" key={navitem.linkname} style={this.navliststyle} to={navitem.linkto}>
            {navitem.linkname}
          </Link>
        </li>
          )}
        <li className="nav-item" style={{position: "relative", borderLeft: "2px solid black",left:"-20px" ,backgroundColor:"darkorange" ,width:"150px" ,top: "-6px"}}>
          <Link className="nav-link" to={"/home/cart"} style={{color:"black", display:"flex"}}>
            <Badge badgeContent={this.props.productincart.length} color="primary" style={{position: "relative" ,top: "0px", left:"10px",float: "left" ,}}>
              <ShoppingCartIcon style={{fontSize: "35px"}} />
              ShoppingCart
            </Badge>
          </Link>
        </li>
      </ul>
      </div>
    </nav>
    </div>
  );
  }
}

export default connect(mapStateToProps)(NavBar);
